import React, { Component } from 'react';

import './App.css';

class NavBar extends React.Component {
  render() {
    return (
      <div>
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark fixed-top">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="nav-link" href="#section1">Section 1</a>
              </li>
              <li className="nav-item">
              <a className="nav-link" href="#section2">Section 2</a>
              </li>
              <li className="nav-item">
              <a className="nav-link" href="#section3">Section 3</a>
              </li>

          </ul>
        </nav>

        <div id="section1" className="container-fluid bg-success" style="padding-top:70px;padding-bottom:70px">
        <h1>Section 1</h1>
      </div>
        <div id="section2" className="container-fluid bg-warning" style="padding-top:70px;padding-bottom:70px">
        <h1>Section 2</h1>
      </div>
        <div id="section3" className="container-fluid bg-secondary" style="padding-top:70px;padding-bottom:70px">
        <h1>Section 3</h1>
        </div>
        </div>


    );
  }
}

export default NavBar;
